import { Line } from 'react-chartjs-2';
import {
    Chart as ChartJS,
    LineElement,
    CategoryScale,
    LinearScale,
    PointElement
} from 'chart.js'

ChartJS.register(
    LineElement,
    CategoryScale,
    LinearScale,
    PointElement
)

export default function Graph() {
    const data = {
        labels: [1, 2, 3],
        datasets: [{
            data: [4, 5, 7],
            backgroundColor: 'transparent',
            borderColor: '#f26c6d'
        }]
    }

    const options = {};


    return (
        <div>
            <div style={{width: '500px', height: '500px', marginLeft: '20px'}}>
                <Line data={data} options={options}></Line>
            </div>
            <div>
                {this.props.graph.x}
                hi
            </div>
        </div>


    )

};
